import React from 'react';
import styled from 'styled-components';
import {ListGroup, Row, Col} from 'react-bootstrap';
import {Layout} from './components/Layout';

const Styles = styled.div`
    .list-group {
        backgroundColor: #A071A9;
    }

    .list-group .list-group-item {
        backgroundColor: #A071A9;
    }
`;

var styles = {
    item: {
        backgroundColor: "#A071A9",
        color: "white",
        borderStyle: "none"
    }
}
export const Contact = () => (
    <Styles>
        <Layout>
            <Row>
                <Col>

                </Col>
                <Col style={{backgroundColor: "white"}}>
                    <ListGroup variant="flush" className="list-group">
                            <ListGroup.Item className="list-group-item" style={styles.item}>Cras justo odio</ListGroup.Item>
                            <ListGroup.Item className="list-group-item" style={styles.item}>Dapibus ac facilisis in</ListGroup.Item>
                            <ListGroup.Item className="list-group-item" style={styles.item}>Morbi leo risus</ListGroup.Item>
                    </ListGroup>
                </Col>
            </Row>
        </Layout>
    </Styles>
)
